import { colors } from "../Colors";
import logo from "../../assets/black-bishop.png";
import { Cell } from "../Cell";

enum FigureNames {}

export class Figure {
	color: colors;
	logo: typeof logo | null;
	cell: Cell;
	name: FigureNames;
	id: number;
	constructor(color: colors, cell: Cell) {
		this.color = color;
		this.cell = cell;
	}
}
